/////////////////////////////////////////////////////////////////////////\n\n\n// * Breakpoints mixins\n// =============================================================================\n\n// ** The default breakpoints are for ALL screens, this is so we have some styling\n//    in place for Print\n//    There is a separate breakpoint for print only as well\n//\n// 2 kinds of queries:\n// - per breakpoint, where you can also choose a media type (defaults to 'all')\n// - print (a shortcut for @media only print)\n//\n// Usage:\n// - inside a selector (hard to manage)\n// - grouping various selectors (better)\n//\n// Examples:\n//\n// body {\n//   @include bp-md {\n//     background: red;\n//   }\n// }\n//\n// @include bp-md {\n//   body {\n//     background: red;\n//   }\n// }\n\n\n// -- phone size only (from 0 to tablet-1px )\n\n@mixin bp-xs-only {\n  @media (max-width: $bp-xs-max) {\n    @content;\n  }\n}\n\n// -- Wide phone and bigger\n\n@mixin bp-xs-wide {\n  @media (min-width: $bp-xs-wide) {\n    @content;\n  }\n}\n\n// -- landscape phone only: 480 up to tablet-1px\n\n@mixin bp-xs-wide-only {\n  @media (min-width: $bp-xs-wide) and (max-width: $bp-xs-wide-max) {\n    @content;\n  }\n}\n\n// -- Tablet portrait and bigger\n\n@mixin bp-sm {\n  @media (min-width: $bp-sm) {\n    @content;\n  }\n}\n\n// -- Tablet portrait size only\n\n@mixin bp-sm-only {\n  @media (min-width: $bp-sm) and (max-width: $bp-sm-max) {\n    @content;\n  }\n}\n\n// -- Phone + tablet\n\n@mixin bp-sm-max {\n  @media (max-width: $bp-sm-max) {\n    @content;\n  }\n}\n\n// -- Desktop (or tablet landscape) and bigger\n\n@mixin bp-md {\n  @media (min-width: $bp-md) {\n    @content;\n  }\n}\n\n// -- Desktop only\n\n@mixin bp-md-only {\n  @media (min-width: $bp-md) and (max-width: $bp-md-max) {\n    @content;\n  }\n}\n\n// -- Bigger than desktop but smaller than\n\n@mixin bp-lg {\n  @media (min-width: $bp-lg) {\n    @content;\n  }\n}\n\n@mixin bp-xl {\n  @media (min-width: $bp-xl) {\n    @content;\n  }\n}\n\n// -- Print css only\n\n@mixin print {\n  @media only print {\n    @content;\n  }\n}\n",'////////////////////////////////////////////////////////////////////////////////\n// *\n// * Product Filters\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Facets in overview (product complex)\n// ===========================================================================\n\n// -- we get a column of Filters\n//    hidden on mobile, with some JS to fold out\n\n// load font-family after font loaded\n.font-text-01-loaded .overview--product-overview .block--provider-facets h2 {\n  font-family: $font-base;\n}\n\n.overview--product-overview {\n\n  // ** facet block by default\n\n  .block--provider-facets {\n    margin-bottom: rem($gap-vert-lg);\n\n    h2 {\n      margin-bottom: rem($gap-vert);\n      font-family: $font-fallback;\n      @include font-size($font-size-base, $line-height-base);\n      text-transform: none;\n      font-weight: $font-weight-bold;\n    }\n\n    // -- list default\n\n    [class*="item-list"] {\n      @include list-reset;\n    }\n\n    // -- list: checkboxes & radios: spacing & positioning for radio/checkbox\n\n    .item-list__checkbox,\n    .item-list__radio,\n    .item-list__radiobutton {\n\n      cursor: pointer;\n\n      .facet-item {\n        position: relative;\n        padding-left: rem(40);\n      }\n\n      input {\n        position: absolute;\n        left: 0;\n      }\n    }\n\n    // -- list item by default\n\n    .facet-item {\n      @include list-reset;\n\n      // -- link\n      a {\n\n        display: flex;\n\n        &,\n        &:visited {\n          color: $color-base;\n        }\n\n        &:hover,\n        &:active,\n        &.is-active {\n          color: $color-link;\n        }\n      }\n\n      .facet-item__value {\n        display: inline-block;\n        padding-top: rem(9);\n      }\n\n      .product-facet-item__status {\n        display: none;\n      }\n\n      .product-facet-item__value {\n        flex-grow: 1; // push the number to the right edge\n      }\n\n      .product-facet-item__count {\n        margin-left: rem(10);\n      }\n    }\n\n  }\n\n  // ** Categories\n\n  .block--facet-blockproduct-categories {\n\n    [class*="facets-widget-"] {\n      padding: rem($padding-product-categories);\n      background-color: $color-product-categories-bg;\n    }\n\n    [class*="item-list"] {\n      margin-bottom: 0;\n    }\n  }\n\n  // ** Properties\n\n  // …\n\n}\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: only on mobile\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-xs-only {\n\n  // ** collapsible filters on mobile phone (because not a lot of room)\n\n  .overview--product-overview {\n\n    .block--provider-facets {\n      // margin-bottom: rem($gap-vert-lg);\n\n      h2 {\n        position: relative;\n        cursor: pointer;\n        margin-bottom: 0;\n        padding: 0 rem(25) 0 0;\n        transition: all $duration $easing;\n\n        @include font-awesome((\n          icon: $fa-var-chevron-down,\n          color: $color-base,\n          size: 16,\n          element: "before"));\n\n        // -- icon\n\n        &:before {\n          position: absolute;\n          right: 0;\n          top: rem(6);\n          transform: rotate(90deg);\n          transition: all $duration $easing;\n        }\n      }\n\n      // -- facets with a background-color\n      &.block--facet-blockproduct-categories [class*="facets-widget-"] {\n        padding: 0;\n        transition: all $duration $easing;\n      }\n\n      // -- default facet list items\n      .facet-item,\n      .form__dropdown {\n        overflow: hidden;\n        max-height: 0;\n        transition: all $duration $easing;\n      }\n\n      // ** states\n\n      &.js-open {\n\n        h2 {\n          margin-bottom: rem($gap-vert);\n          color: $color-spot-1;\n\n          &:hover {\n            color: $color-spot-1;\n          }\n\n          &:before {\n            transform: rotate(0);\n            transform-origin: center center;\n          }\n        }\n\n        // -- facets with a background-color\n        &.block--facet-blockproduct-categories [class*="facets-widget-"] {\n          padding: rem($padding-product-categories);\n        }\n\n        .facet-item,\n        .form__dropdown {\n          max-height: rem(100); // think of the heighest this could get when open\n        }\n\n        .facet-item {\n          margin-bottom: rem($gap-vert-xs);\n          min-height: rem(35);\n        }\n      }\n    }\n\n  }\n\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: tablet & wider\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-xs-wide-only {\n  //\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: tablet & wider\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-sm {\n\n  .overview--product-overview {\n\n    // ** facet block by default\n\n    .block--provider-facets {\n\n      // -- list: checkboxes & radios: spacing & positioning for radio/checkbox\n\n      .item-list__checkbox,\n      .item-list__radio,\n      .item-list__radiobutton {\n\n        .facet-item {\n          margin-bottom: rem($gap-vert-xs);\n          min-height: rem(35);\n        }\n      }\n    }\n  }\n}\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: desktop\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-md {\n  //\n}\n','////////////////////////////////////////////////////////////////////////////////\n// *\n// * Variables: typography\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// ** Fonts\n// =============================================================================\n\n// if fonts take too long to load,\n// and the user sees unstyled text\n// we can set a preloader\n$font-preloader: false;\n\n// make sure this font matches with the font set in html.twig!!!\n$font-base: "Montserrat", "Arial", sans-serif !default;\n$font-heading: $font-base !default;\n$font-fallback: "Arial", sans-serif;\n\n// size\n$font-size-base: 16 !default;\n$font-size-sm: 13 !default;\n$font-size-xs: 11 !default;\n\n// line-height\n$line-height-base: 23 !default;\n$line-height-sm: 20 !default;\n$line-height-xs: 15 !default;\n\n// weight\n$font-weight-normal: normal !default;\n$font-weight-bold: bold !default;\n\n// base html font size, used for calculating px to rem\n// if you want px and rem to be the same value,\n// set this to 10 instead\n$rem-base: 16;\n\n\n// * Headings\n// =============================================================================\n// -- Set your h1, h2, ... size (don\'t use px!) and color\n\n$h1-size: 40;\n$h1-line: 47;\n$h1-color: $color-heading;\n\n$h2-size: 35;\n$h2-line: 40;\n$h2-color: $color-heading;\n\n$h3-size: 28;\n$h3-line: 32;\n$h3-color: $color-heading;\n\n$h4-size: 20;\n$h4-line: 26;\n$h4-color: $color-heading;\n','////////////////////////////////////////////////////////////////////////////////\n// *\n// * Mixins: Typography\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Overview\n// =============================================================================\n\n// ** font-face\n// ** font-size\n// ** font-awesome\n// ** hide-text\n// ** hide-icontext\n// ** text-nobreak\n// ** ellipsis\n// ** word-break\n// ** m-p-reset\n\n\n// * Mixins\n// =============================================================================\n\n// ** enable font-smoothing can be helpful on older screens,\n//    for fonts that do not have subpixel rendering\n//    or it could not? Who the hell knows…\n\n@mixin font-smoothing($value: off) {\n  @if $value == on {\n    -webkit-font-smoothing: antialiased;\n    -moz-osx-font-smoothing: grayscale;\n  }\n  @else {\n    -webkit-font-smoothing: subpixel-antialiased;\n    -moz-osx-font-smoothing: auto;\n  }\n}\n\n\n// ** use font-face to generate all the different url\'s for the various font files\n//    By default will only load woff and woff2 files, but you can use legacy formats as well\n//     using the \'legacy\' variable\n//    Settings:\n//       font-family,\n//       font-style: normal,\n//       font-weight: normal,\n//       font-display: swap, (best for loading and display of fonts)\n//       file-path, (location of font files, relative to css-folder, or can be absolute using \'://\')\n//       cache-string: "cache_busting_variable", (this will attempt to bust the cache, set emtpy string "" if you don\'t want that)\n//       unicode-range: null,\n//       legacy: false, (if set to true, it will try to load older font file formats: eot and ttf)\n// -- USAGE: @include font-face(($font-family: "Montserat", $font-style: "normal"));\n\n@mixin font-face($settings) {\n\n  // some defaults, used in case no $settings were given\n  // or when either of the settings is omitted\n  $font-family-default: "";\n  $font-style-default: normal;\n  $font-weight-default: normal;\n  $font-display-default: swap;\n  $file-path-default: "";\n  $cache-string-default: "cache_busting_variable";\n  $unicode-range-default: null;\n  $legacy-default: false;\n\n  // initiate the actual variables that will be used\n  $font-family: null;\n  $font-style: null;\n  $font-weight: null;\n  $font-display: null;\n  $file-path: null;\n  $cache-string: null;\n  $unicode-range: null;\n  $legacy: null;\n\n  // map the variables to the settings if actual settings are passed\n  @if ($settings != null) {\n    $font-family: map-get($settings, font-family);\n    $font-style: map-get($settings, font-style);\n    $font-weight: map-get($settings, font-weight);\n    $font-display: map-get($settings, font-display);\n    $file-path: map-get($settings, file-path);\n    $cache-string: map-get($settings, cache-string);\n    $unicode-range: map-get($settings, unicode-range);\n    $legacy: map-get($settings, legacy);\n  }\n\n  // if any are not filled in, fall back to defaults\n  @if ($font-family == null) {\n    $font-family: $font-family-default;\n  }\n  @if ($font-style == null) {\n    $font-style: $font-style-default;\n  }\n  @if ($font-weight == null) {\n    $font-weight: $font-weight-default;\n  }\n  @if ($font-display == null) {\n    $font-display: $font-display-default;\n  }\n  @if ($file-path == null) {\n    $file-path: $file-path-default;\n  }\n  @if ($cache-string == null) {\n    $cache-string: $cache-string-default;\n  }\n  @if ($unicode-range == null) {\n    $unicode-range: $unicode-range-default;\n  }\n  @if ($legacy == null) {\n    $legacy: $legacy-default;\n  }\n\n  @font-face {\n    font-family: $font-family;\n    font-weight: $font-weight;\n    src: _font-source-declaration($font-family, $file-path, $cache-string, $legacy);\n    font-display: $font-display;\n    @if ($unicode-range != null) {\n      unicode-range: $unicode-range;\n    }\n    @content;\n  }\n}\n\n\n// ** Font-size mixin: easily set font-size and line-height of an element\n// -- NOTE: default font-size comes from the base vars (eg. 13), default line-height as well (eg. 18)\n// -- USAGE: @include font-size(15, 18) (don\'t use px!) -> sets font-size to 15 and line-height to a ratio of 18/15 = 1.1385\n// -- USAGE: @include font-size(15, 18, true) -> scales the font-size & line-height per breakpoint. The starting values you pass, are used on bp-lg only\n// -- USAGE: @include font-size(15, 18, true, (scale-xs: 1.3, scale-sm: 1.2, scale-md: 1.1, scale-lg: 1) ) -> pass scaling per breakpoint\n\n@mixin font-size($size: $font-size-base, $line: ($size * $line-height-base / $font-size-base), $responsive: false, $responsive-params: null) {\n  font-size: rem($size);\n  line-height: rem($line);\n\n  @if ($responsive == true) {\n\n    // some defaults, used in case no $settings were given\n    // or when either of the settings is omitted\n    $scale-xs-default: 1.3;\n    $scale-sm-default: 1.2;\n    $scale-md-default: 1.1;\n    $scale-lg-default: 1;\n\n    // set up the actual variables that will be used\n    $scale-xs: null;\n    $scale-sm: null;\n    $scale-md: null;\n    $scale-lg: null;\n\n    // map the variables to the settings if actual settings are passed\n    @if ($responsive-params != null) {\n      $scale-xs: map-get($responsive-params, scale-xs);\n      $scale-sm: map-get($responsive-params, scale-sm);\n      $scale-md: map-get($responsive-params, scale-md);\n      $scale-lg: map-get($responsive-params, scale-lg);\n    }\n\n    // if any are not filled in, fall back to defaults\n    @if ($scale-xs == null) {\n      $scale-xs: $scale-xs-default;\n    }\n    @if ($scale-sm == null) {\n      $scale-sm: $scale-sm-default;\n    }\n    @if ($scale-md == null) {\n      $scale-md: $scale-md-default;\n    }\n    @if ($scale-lg == null) {\n      $scale-lg: $scale-lg-default;\n    }\n\n    $newSizeXs: ($size / $scale-xs);\n    $newLineXs: ($line / $scale-xs);\n    $newSizeSm: ($size / $scale-sm);\n    $newLineSm: ($line / $scale-sm);\n    $newSizeMd: ($size / $scale-md);\n    $newLineMd: ($line / $scale-md);\n    $newSizeLg: ($size / $scale-lg);\n    $newLineLg: ($line / $scale-lg);\n\n    @include bp-xs-only {\n\n      @if ($newSizeXs >=  ($font-size-base - 1)) {\n        @include font-size($newSizeXs, $newLineXs);\n      } @else {\n        @include font-size($font-size-base, $line-height-base);\n      }\n    }\n\n    @include bp-sm-only {\n\n      @if ($newSizeSm >=  ($font-size-base - 1)) {\n        @include font-size($newSizeSm, $newLineSm);\n      } @else {\n        @include font-size($font-size-base, $line-height-base);\n      }\n    }\n\n    @include bp-md-only {\n\n      @if ( $newSizeMd >=  ($font-size-base - 1)) {\n        @include font-size($newSizeMd, $newLineMd);\n      } @else {\n        @include font-size($font-size-base, $line-height-base);\n      }\n    }\n\n    @include bp-lg {\n\n      @if ($newLineLg >=  ($font-size-base - 1)) {\n        @include font-size($newSizeLg, $newLineLg);\n      } @else {\n        @include font-size($font-size-base, $line-height-base);\n      }\n    }\n\n  }\n}\n\n\n// *\n// * Font-awesome mixin: add a font-awesome icon before or after an element\n//\n// * NOTE: before is default, margin is default 0.\n//\n// * Settings via an object, containing:\n// * $element: pseudo-element, default = before,\n// * $position,\n// * $left,\n// * $top,\n// * $type:"regular",\n// * $icon: eg. a fontawesome variable,\n// * $color,\n// * $color-secondary: for duotone icons, this is the second the icon, defaults to same as primary,\n// * $size,\n// * $align:middle,\n// * $margin...\n//\n// * USAGE:\n// * $hamburgerIcon: (icon: $fa-var-hamburger, color: $color-white, size: 21px);\n// * @include font-awesome($hamburgerIcon);\n// * $duotoneIcon: (icon: $fa-var-hamburger, color: $color-white, color-secondary: $color-white, size: 21px)\n// * @include font-awesome($hamburgerIcon);\n\n@mixin font-awesome($settings) {\n\n  // set variables\n  $type: map-get($settings, type);\n  $icon: map-get($settings, icon);\n  $element: map-get($settings, element);\n  $position: map-get($settings, position);\n  $left: map-get($settings, left);\n  $right: map-get($settings, right);\n  $top: map-get($settings, top);\n  $bottom: map-get($settings, bottom);\n  $bottom: map-get($settings, bottom);\n\n\n  // some defaults, used in case no $settings were given\n  // or when either of the settings is omitted\n  $swap-opacity-default: false;\n  $opacity-default: 1;\n  $opacity-secondary-default: .4;\n  $color-default: inherit;\n\n  // set up the actual variables that will be used\n  $swap-opacity: null;\n  $opacity: null;\n  $opacity-secondary: null;\n  $color: null;\n  $color-secondary: null;\n\n  // map the variables to the settings if actual settings are passed\n  @if ($settings != null) {\n    $swap-opacity: map-get($settings, swap-opacity);\n    $opacity: map-get($settings, opacity);\n    $opacity-secondary: map-get($settings, opacity-secondary);\n    $color: map-get($settings, color);\n    $color-secondary: map-get($settings, color-secondary);\n  }\n\n  // if any are not filled in, fall back to defaults\n  @if ($swap-opacity == null) {\n    $swap-opacity: $swap-opacity-default;\n  }\n  @if ($opacity == null) {\n    $opacity: $opacity-default;\n  }\n  @if ($opacity-secondary == null) {\n    $opacity-secondary: $opacity-secondary-default;\n  }\n  @if ($color == null) {\n    $color: $color-default;\n  }\n  // secondary color falls back to primary if none set\n  @if ($color-secondary == null) {\n    $color-secondary: $color;\n  }\n\n  // if using duotone icons, we need to stack 2 pseudo-elements\n  @if ($type == "duotone") {\n\n    &:before,\n    &:after {\n      display: inline-block;\n    }\n\n    &:before {\n\n      @include font-awesome-pseudo($settings);\n      opacity: $opacity;\n\n      @if($position != null) {\n        position: $position;\n      } @else {\n        position: relative;\n        line-height: inherit;\n        vertical-align: bottom;\n      }\n      @if($left != null) {\n        left: $left;\n      }\n      @else if($left == null and $right != null) {\n        right: $right;\n      }\n      @if($top != null) {\n        top: $top;\n      }\n      @else if($top == null and $bottom != null) {\n        bottom: $bottom;\n      }\n    }\n\n    &:after {\n\n      // all second icons in the duotone stack use the same variant name: \'10\' + the original icon unicode\n      // so we can manipulate that string in Sass to obtain that icon\n      // eg: \\f805 becomes \\10f805\n      $icon-secondary: str-insert($icon, "10", 2);\n\n      // copy the icon settings but replace the color + the icon\n      // by basically merging the original map with a new one only containing the color\n      $settings-secondary: map-merge($settings, (color: $color-secondary, icon: $icon-secondary));\n\n      @include font-awesome-pseudo($settings-secondary);\n      opacity: $opacity-secondary;\n\n      @if($position != null) {\n        position: $position;\n      } @else {\n        position: absolute;\n        left: 0;\n        line-height: inherit;\n        vertical-align: bottom;\n      }\n      @if($left != null) {\n        left: $left;\n      }\n      @else if($left == null and $right != null) {\n        right: $right;\n      }\n      @if($top != null) {\n        top: $top;\n      }\n      @else if($top == null and $bottom != null) {\n        bottom: $bottom;\n      }\n    }\n\n    @if ($swap-opacity) {\n      &:before {\n        opacity: $opacity-secondary;\n      }\n\n      &:after {\n        opacity: $opacity;\n      }\n    }\n\n    // if no duotone needed, we can add fontawesome styling to a single pseudo-element only\n  } @else {\n\n    @if ($element == "after" or $element == ":after" or $element == "::after") {\n      &:after {\n        @if($position != null) {\n          position: $position;\n        }\n        @if($left != null) {\n          left: $left;\n        }\n        @else if($left == null and $right != null) {\n          right: $right;\n        }\n        @if($top != null) {\n          top: $top;\n        }\n        @else if($top == null and $bottom != null) {\n          bottom: $bottom;\n        }\n        @include font-awesome-pseudo($settings);\n      }\n    } @else {\n      &:before {\n        @if($position != null) {\n          position: $position;\n        }\n        @if($left != null) {\n          left: $left;\n        }\n        @else if($left == null and $right != null) {\n          right: $right;\n        }\n        @if($top != null) {\n          top: $top;\n        }\n        @else if($top == null and $bottom != null) {\n          bottom: $bottom;\n        }\n        @include font-awesome-pseudo($settings);\n      }\n    }\n\n  }\n\n}\n\n@mixin font-awesome-pseudo($settings) {\n\n  // -- set variables\n\n  $type: map-get($settings, type);\n  $icon: map-get($settings, icon);\n  $color: map-get($settings, color);\n  $size: map-get($settings, size);\n  $align: map-get($settings, align);\n  $margin: map-get($settings, margin);\n\n  // -- fontawesome defaults:\n  //\n  // $fa-font-path:         "../webfonts" !default;\n  // $fa-font-size-base:    16px !default;\n  // $fa-font-display:      auto !default;\n  // $fa-css-prefix:        fa !default;\n  // $fa-version:           "5.12.0" !default;\n  // $fa-border-color:      #eee !default;\n  // $fa-inverse:           #fff !default;\n  // $fa-li-width:          2em !default;\n  // $fa-fw-width:          (20em / 16);\n  // $fa-primary-opacity:   1 !default;\n  // $fa-secondary-opacity: .4 !default;\n\n  content: unquote("\\"#{ $icon }\\"");\n  display: inline-block;\n  $newMargin: if(length($margin) == 0, 0px, $margin);\n  margin: $newMargin;\n\n  @include font-awesome-core;\n\n  @if ($align == null) {\n    // vertical-align: -.125em;\n    vertical-align: middle;\n  } @else {\n    vertical-align: $align;\n  }\n\n  // -- set default size\n\n  @if ($size == 16px or $size == 16 or $size == null) {\n    $size: $fa-font-size-base;\n  }\n\n  font-size: rem($size);\n\n  // -- set font style/weight\n\n  @if ($fontawesome-version == "free") {\n\n    @if ($type == "brand") {\n      font-family: "Font Awesome 5 Brands", sans-serif;\n      font-weight: normal;\n    } @else if ($type == "regular") {\n      font-family: "Font Awesome 5 Free", sans-serif;\n      font-weight: 400;\n    } @else {\n      // solid (so anything marked as "light" will fallback to this)\n      font-family: "Font Awesome 5 Free", sans-serif;\n      font-weight: 900;\n    }\n\n  } @else {\n\n    @if ($type == "duotone") {\n      font-family: "Font Awesome 5 Duotone", sans-serif;\n      font-weight: 900;\n    } @else if ($type == "brand") {\n      font-family: "Font Awesome 5 Brands", sans-serif;\n      font-weight: normal;\n    } @else if ($type == "regular") {\n      font-family: "Font Awesome 5 Pro", sans-serif;\n      font-weight: 400;\n    } @else if ($type == "light") {\n      font-family: "Font Awesome 5 Pro", sans-serif;\n      font-weight: 300;\n    } @else {\n      // solid\n      font-family: "Font Awesome 5 Pro", sans-serif;\n      font-weight: 900;\n    }\n  }\n\n  color: $color;\n\n}\n\n@mixin font-awesome-core {\n  -webkit-font-smoothing: antialiased;\n  -moz-osx-font-smoothing: grayscale;\n  font-style: normal;\n  font-variant: normal;\n  font-weight: normal;\n  line-height: 1;\n}\n\n// ** Hide an element\'s content\n\n@mixin hide-text {\n  overflow: hidden;\n  text-indent: 110%;\n  white-space: nowrap;\n}\n\n// ** hide text of an element with a font-awesome icon without hiding icon itself\n\n@mixin hide-icontext() {\n  overflow: hidden;\n  text-indent: 110%;\n  white-space: nowrap;\n\n  &:before {\n    text-indent: -110%; // compensate for text-indent\n  }\n}\n\n// ** Don\'t break up text\n\n@mixin text-nobreak {\n  white-space: nowrap;\n  -ms-word-break: keep-all;\n  word-break: keep-all;\n}\n\n// ** end text if no space\n\n@mixin ellipsis($width: 100%) {\n  display: inline-block;\n  overflow: hidden;\n  max-width: $width;\n  text-overflow: ellipsis;\n  white-space: nowrap;\n  word-wrap: normal;\n}\n\n// ** Break long strings (eg. emailaddresses)\n\n@mixin word-break($hyphen:false) {\n  /* These are technically the same, but use both */\n  overflow-wrap: break-word;\n  word-wrap: break-word;\n\n  -ms-word-break: break-all;\n  /* This is the dangerous one in WebKit, as it breaks things wherever */\n  word-break: break-all;\n  /* Instead use this non-standard one: */\n  word-break: break-word;\n\n  /* Adds a hyphen where the word breaks, if supported (No Blink) */\n  @if ($hyphen) {\n    -ms-hyphens: auto;\n    -moz-hyphens: auto;\n    -webkit-hyphens: auto;\n    hyphens: auto;\n  }\n}\n\n// ** remove all padding and margin on element\n\n@mixin m-p-reset {\n  margin: 0;\n  padding: 0;\n}\n','////////////////////////////////////////////////////////////////////////////////\n// *\n// * Lists: helpers\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n// * Mixins\n// =============================================================================\n\n// ** list-reset\n// -- Reset list item defaults when no margin, padding, list styles needed\n@mixin list-reset {\n  display: block;\n  margin: 0;\n  padding: 0;\n  list-style: none;\n}\n\n// ** Styling for lists in text\n// -- http://www.456bereastreet.com/archive/201105/styling_ordered_list_numbers/\n// USAGE: @include list; (without parameter, defaults to unsorted style)\n// --     @include list((type: "sorted")) gives you a sorted list\n// --     @include list($some-variable) use a variable to add your settings (don\'t forget the extra brackets!)\n//\n// settings:\n// -- type: "sorted" or "unsorted"\n// -- spacing: space between the individual list items (uses margin-bottom for this)\n\n// -- bullet: ("unsorted" list only) a keyword for the shape ("disk", "circle", "square")\n// -- bullet-color: ("unsorted" list only) color of the bullet\n// -- bullet-size: ("unsorted" list only) px width & height (if shape) OR px font size (if icon)\n// -- bullet-weight: ("unsorted" list only) (only if icon) the font-awesome type: "light", "regular", "solid" or "brand"\n\n// -- number-font: ("sorted" list only) the font used for the number\n// -- number-space: ("sorted" list only) space available for the number to live in (space between left hand side and start of the text\n// -- number-color: ("sorted" list only) color of the number\n// -- number-delimiter: character that comes after the bullet in sorted lists ("." by default)\n//\n@mixin list($settings: null) {\n\n  // some defaults, used in case no $settings were given\n  // or when either of the settings is omitted\n  $type-default: "unsorted";\n  $bullet-default: "disk";\n  $bullet-color-default: $color-spot-2;\n  $bullet-size-default: 6;\n  $number-font-default: $font-heading;\n  $number-color-default: $bullet-color-default;\n  $spacing-default: ($gap-vert/4);\n  $number-delimiter-default: ".";\n\n  // set up the actual variables that will be used\n  $type: null;\n  $bullet: null;\n  $bullet-color: null;\n  $bullet-size: null;\n  $number-font: null;\n  $number-color: null;\n  $spacing: null;\n  $number-delimiter: null;\n\n  // map the variables to the settings if actual settings are passed\n  @if ($settings != null) {\n    $type: map-get($settings, type);\n    $bullet: map-get($settings, bullet);\n    $bullet-color: map-get($settings, bullet-color);\n    $bullet-size: map-get($settings, bullet-size);\n    $number-font: map-get($settings, number-font);\n    $number-color: map-get($settings, number-color);\n    $spacing: map-get($settings, spacing);\n    $number-delimiter: map-get($settings, number-delimiter);\n  }\n\n  // if any are not filled in, fall back to defaults\n  @if ($type == null) {\n    $type: $type-default;\n  }\n  @if ($bullet == null) {\n    $bullet: $bullet-default;\n  }\n  @if ($bullet-color == null) {\n    $bullet-color: $bullet-color-default;\n  }\n  @if ($bullet-size == null) {\n    $bullet-size: $bullet-size-default;\n  }\n  @if ($number-font == null) {\n    $number-font: $number-font-default;\n  }\n  @if ($number-color == null) {\n    $number-color: $number-color-default;\n  }\n  @if ($spacing == null) {\n    $spacing: $spacing-default;\n  }\n  @if ($number-delimiter == null) {\n    $number-delimiter: $number-delimiter-default;\n  }\n\n  // Shared styling\n\n  display: block;\n  padding-left: 0;\n  margin-left: 0;\n\n  & > li {\n    position: relative; // Create a positioning context\n    display: block;\n    margin-bottom: rem($spacing);\n    list-style: none; // Disable the normal item numbering\n\n    &:last-child {\n      margin-bottom: 0;\n    }\n  }\n\n  // ** list with numbers\n\n  @if $type == "sorted" {\n\n    $listSettings: (\n      type: $type,\n      number-font: $number-font,\n      number-color: $number-color,\n      spacing: $spacing,\n      number-delimiter: $number-delimiter\n    );\n\n    @include list-sorted($listSettings);\n\n    // ** list with bullets\n\n  } @else {\n\n    $listSettings: (\n      type: $type,\n      bullet: $bullet,\n      bullet-color: $bullet-color,\n      bullet-size: $bullet-size,\n      spacing: $spacing,\n      number-delimiter: $number-delimiter\n    );\n\n    @include list-unsorted($listSettings);\n\n  }\n\n}\n\n\n@mixin list-sorted($settings: null) {\n\n  // map the variables to the settings if actual settings are passed\n  $number-font: map-get($settings, number-font);\n  $number-color: map-get($settings, number-color);\n  $spacing: map-get($settings, spacing);\n  $number-delimiter: map-get($settings, number-delimiter);\n\n  counter-reset: listStyle1; // Initiate a counter\n\n  & > li {\n    padding-left: rem(26); // space for the counter\n    counter-increment: listStyle1; // Increment the counter by 1\n\n    &:before {\n      position: absolute;\n      top: 0;\n      left: 0;\n      content: counter(listStyle1) "."; // Use the counter as content\n      font-family: $number-font;\n      font-weight: 600;\n      @include font-size($font-size-base, $line-height-base);\n      color: $number-color;\n\n      // optional: for looong numbered lists, to make sure the number-delimiters are aligned, you can align them to the right\n      //\n      // width: rem($number-space - 12); // leave some space so it doesn"t stick to the text\n      // text-align: right; // align on the number-delimiter\n    }\n\n    // 2nd & 3rd levels: get their own counter\n    //\n    ol {\n      counter-reset: listStyle2;\n\n      > li {\n        counter-increment: listStyle2; // Increment the new counter by 1\n\n        &:before {\n          content: counter(listStyle2, lower-alpha) ".";\n        }\n      }\n    }\n\n    ol > li > ol {\n      counter-reset: listStyle3;\n\n      > li {\n        counter-increment: listStyle3; // Increment the new counter by 1\n\n        &:before {\n          content: counter(listStyle3, lower-roman) ".";\n        }\n      }\n    }\n\n  }\n\n}\n\n\n@mixin list-unsorted($settings: null) {\n\n  $bullet: map-get($settings, bullet);\n  $bullet-color: map-get($settings, bullet-color);\n  $bullet-size: map-get($settings, bullet-size);\n  $spacing: map-get($settings, spacing);\n\n  & > li {\n    padding-left: rem(13 + $bullet-size); // space for the counter\n\n    &:before {\n      content: "";\n      position: absolute;\n      left: 1px; // push it in a bit because round shapes tend to look bigger and thus outside the edge\n      top: rem($line-height-base / 2); // half of line-height\n      display: block;\n      margin-top: -1px; // pull it up a bit, to align with letters x-height\n      width: rem($bullet-size);\n      height: rem($bullet-size);\n\n      @if ($bullet == "circle") {\n        border: 1px solid $bullet-color;\n        border-radius: 50%;\n      }\n\n      @else if ($bullet == "disk") {\n        border-radius: 50%;\n        background: $bullet-color;\n      }\n\n      @else {\n        background: $bullet-color;\n      }\n    }\n\n    ul {\n      // second level: circle bullet\n\n      li {\n        &:before {\n          border: 1px solid $bullet-color;\n          border-radius: 50%;\n          background: transparent;\n        }\n\n        // third level: square filled bullet\n\n        li {\n          &:before {\n            border: 0 none;\n            border-radius: 0;\n            background: $bullet-color;\n          }\n        }\n      }\n\n    }\n  }\n\n}\n',"////////////////////////////////////////////////////////////////////////////////\n// *\n// * Variables: basic colors\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// ** Palette\n// =============================================================================\n\n$color-spot-1:              #14427d !default;\n$color-spot-2:              #62bdc2 !default;\n//$color-spot-3:              #002c50 !default;\n\n$color-black:                #000000 !default;\n$color-white:                #fff !default;\n\n$color-off-white:            #e7f6f7; //#F2FCFC; // #f3f3f3 !default;\n\n$color-gray-light-1:         #e5e5e5 !default;\n$color-gray-light-2:         #d1d1d1 !default;\n$color-gray-light-3:         #a2a2a2 !default;\n$color-gray:                 #707070 !default;\n$color-gray-dark:            #545454 !default;\n$color-gray-dark-2:          #212121 !default;\n\n\n// ** Main\n// =============================================================================\n\n$color-base:                #39596a !default;\n$color-base-bg:             $color-white !default;\n\n$color-heading:             $color-base !default;\n\n// -- default link tag colors\n$color-link:                $color-spot-2 !default;\n$color-link-hover :         $color-spot-1 !default;\n$color-link-active:         $color-spot-1 !default;\n\n// -- colors for links in CKE (often different color/underline effect)\n$color-text-link:           $color-spot-2 !default;\n$color-text-link-hover :    $color-spot-2 !default;\n$color-text-link-active:    $color-spot-1 !default;\n\n$color-button:              $color-white !default;\n$color-button-bg:           $color-spot-2 !default;\n$color-button-hover:        $color-white !default;\n$color-button-hover-bg:     #68cfd5 !default;\n\n$color-border:              $color-gray-light-2 !default;\n\n\n// * Regions\n// =============================================================================\n\n$color-header-top-bg:   $color-off-white;\n$color-navigation-bg:   $color-spot-1;\n\n$color-nav-submenu:     lighten($color-spot-1, 10%);\n$color-mobile-nav:      $color-base;\n$color-mobile-nav-bg:   $color-white;\n$color-mobile-nav-open:      $color-white;\n$color-mobile-nav-open-bg:   $color-white;\n\n$color-doormat:         $color-spot-1;\n$color-doormat-bg:      rgba($color-spot-2, .2);\n$color-footer:          #92929f;\n$color-footer-bg:       $color-white;\n\n\n// * Subdivisions\n// =============================================================================\n\n// $color-meta-bg:       $color-gray-light-1;\n\n\n// ** Tabs\n// =============================================================================\n\n$color-tabs-background:     $color-gray-dark;\n$color-tab-text:            $color-white;\n$color-tab-bg:              $color-gray;\n$color-tab-bg-hover:        $color-link;\n$color-tab-bg-active:       $color-link;\n$color-tab-bg-active-2:     $color-white;\n\n\n// * Alerts\n// =============================================================================\n$color-error:             #e74c3c;\n$color-error-dark:        #c0392b;\n$color-status:            #3fc380;\n$color-status-dark:       #00b16a;\n$color-warning:           #eb9532;\n$color-warning-dark:      #f2784b;\n$color-neutral:           #0074bd;\n\n\n// ** Forms\n// =============================================================================\n\n$color-placeholder:          $color-gray-light-2;\n\n$color-form:                 $color-base;\n// $color-form-bg:              $color-border;\n$color-form-border:          $color-border;\n\n$color-form-active:          $color-spot-2 !default;\n// $color-form-active-bg:       $color-white;\n$color-form-active-border:   lighten($color-spot-1, 10);\n\n$color-form-disabled:        $color-gray-light-1;\n$color-form-disabled-bg:     $color-white;\n$color-form-disabled-border: $color-gray-light-1;\n// $color-form-error-bg:        lighten($color-error, 10);\n$color-form-error-border:    $color-error;\n","////////////////////////////////////////////////////////////////////////////////\n// *\n// * Config: Variables: Animation related\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Transitions\n// =============================================================================\n// -- Set general transition params\n\n$duration: 0.3s;\n$easing: ease-in-out;\n$easing-in: ease-in;\n$easing-out: ease-out;\n",'////////////////////////////////////////////////////////////////////////////////\n// *\n// * Product full - Images\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Styling\n// =============================================================================\n\n.product--full {\n\n\n  // * Arrows\n  // ===========================================================================\n\n  // ** all arrows\n\n  .slick-arrow {\n    cursor: pointer;\n    position: absolute;\n    top: 0;\n    z-index: 1;\n\n    height: 100%;\n    width: rem(32);\n\n    font-size: 0; // hide text on button\n\n    color: $color-white;\n    background: rgba($color-product-arrows, .5);\n    transition: all $duration $easing;\n\n    &:hover {\n      background: rgba($color-product-arrows, 1);\n    }\n\n    &.slick-disabled {\n      opacity: 0;\n    }\n  }\n\n  .slick-prev {\n    left: 0;\n\n    @include font-awesome((\n      "icon": $fa-var-chevron-left,\n      "size": 18,\n      "color": $color-white,\n      "position": absolute,\n      "top": 50%,\n      "left": 50%\n    ));\n\n    &:before {\n      width: 100%;\n      text-align: center;\n      transform: translateX(-50%) translateY(-50%);\n    }\n  }\n\n  .slick-next {\n    right: 0;\n\n    @include font-awesome((\n      "icon": $fa-var-chevron-right,\n      "element": "after",\n      "size": 18,\n      "color": $color-white,\n      "position": absolute,\n      "top": 50%,\n      "left": 50%\n    ));\n\n    &:after {\n      width: 100%;\n      text-align: center;\n      transform: translateX(-50%) translateY(-50%);\n    }\n  }\n\n  // * Main Image\n  // ===========================================================================\n\n  .slick--main {\n\n    position: relative;\n    overflow: hidden; // hide the arrows\n    //background: $color-gray-light-1;\n\n    // -- arrows\n\n    &:hover {\n      .slick-prev {\n        left: 0;\n      }\n\n      .slick-next {\n        right: 0;\n      }\n    }\n\n    .slick-prev {\n      left: rem(-32);\n    }\n\n    .slick-next {\n      right: rem(-32);\n    }\n\n    .slick-track {\n      display: flex;\n      align-items: center; // center pictures vertically\n    }\n  }\n\n  // * Thumbnails\n  // ===========================================================================\n\n  .slick--skin--asnavfor {\n\n    position: relative;\n    margin-top: rem($gap-vert);\n    overflow: hidden; // hide slides overflow when sliding\n\n    img {\n      max-height: rem(400);\n    }\n\n    // -- arrows\n\n    .slick-arrow {\n      //\n    }\n\n    .slick-prev {\n      //\n    }\n\n    .slick-next {\n      //\n    }\n\n    // -- Images\n\n    .slick-list {\n      margin: 0 rem(-10);\n    }\n\n    .slide {\n      padding: 0 rem(10);\n    }\n  }\n\n}\n\n// * Colorbox\n// ===========================================================================\n\n// ** fix rendering conflicts with theme\n\n#cboxClose,\n#cboxPrevious,\n#cboxNext {\n  min-height: auto;\n  transition: none;\n}\n\n#cboxCurrent {\n  bottom: 0;\n}\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: tablet & wider\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-md {\n\n  .slick--main {\n    img {\n      margin: 0 auto;\n      max-height: rem(600);\n    }\n  }\n\n}\n',"////////////////////////////////////////////////////////////////////////////////\n// *\n// * Product related: item\n// *\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Styling\n// =============================================================================\n\n.product--related {\n\n  // ** content\n  .layout__content {\n    margin-top: rem($gap-vert);\n  }\n\n  // ** title\n\n  h2,\n  h3,\n  h4 {\n    @include h4;\n\n    a {\n      &,\n      &:visited {\n        color: $color-heading;\n      }\n\n      &:hover,\n      &:active {\n        color: $color-link;\n      }\n    }\n  }\n\n  // ** Properties & categories: Facet filters\n\n  .field--name-field-product-category,\n  .field--name-field-product-property-one,\n  .field--name-field-product-property-two,\n  .field--name-field-product-attributes {\n    display: flex;\n    flex-wrap: wrap;\n    margin-bottom: rem(5);\n    align-items: flex-end;\n    @include font-size($font-size-base, $line-height-base);\n\n    // label\n\n    h3,\n    .label-value-item-label {\n      @include font-size($font-size-base, $line-height-base);\n      margin: 0 rem(10) 0 0;\n\n      @include text-nobreak;\n\n      &:after {\n        content: \":\";\n        margin-left: rem(-4); // counteract the spacing\n      }\n    }\n\n    // value\n    a {\n      //\n    }\n  }\n\n  // ** Product attributes\n\n  .field__item--name-field-product-attributes,\n  .label-value-item-label {\n    @include font-size($font-size-base, $line-height-base);\n  }\n\n  .field--name-field-product-attributes {\n\n    .field__items {\n      //\n    }\n  }\n\n  .field__item--name-field-product-attributes {\n    //\n  }\n\n  .label-value-item {\n    display: flex;\n    flex-wrap: wrap;\n  }\n\n  .label-value-item-label {\n    font-weight: $font-weight-bold;\n    margin-bottom: 0;\n    margin-right: rem(10);\n\n    @include text-nobreak;\n  }\n\n  .label-value-item-value {\n    //\n  }\n\n  // ** 'read more'\n\n  .layout__content__row--bottom {\n    margin-top: rem($gap-vert);\n\n    a {\n      @include link-more;\n    }\n  }\n\n\n}\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: tablet & wider\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-sm {\n\n  // ** stretch for alignment of 'read more'\n\n  .field__item--name-field-product-related-products {\n    display: flex;  // needed for stretching content to align 'read more' link\n  }\n\n  .product--related {\n\n    display: flex;\n\n    .node__content {\n      display: flex;\n      width: 100%; // IE\n    }\n\n    .layout__cols {\n      display: flex;\n      // flex-direction: column;\n      margin-top: 0;\n    }\n\n    .layout__sidebar {\n      @include flex-col(6);\n      flex: 0 1 auto;\n      margin-top: 0;\n    }\n\n    .layout__content {\n      @include flex-col(6);\n      display: flex;\n      flex: 1 0 auto; // flex-grow 1\n      flex-direction: column;\n      margin-top: 0;\n    }\n\n    .layout__content__row--bottom {\n      display: flex;\n      flex-grow: 1;\n      align-items: flex-end;\n    }\n\n    // **********************************************\n    //\n    // ** If it all needs to go in 1 col, use this:\n\n    // .layout__cols {\n    //   display: flex;\n    //   flex-direction: column;\n    //   margin-top: 0;\n    // }\n\n    // .layout__sidebar {\n    //   @include flex-col(12);\n    //   flex: 0 1 auto;\n    //   margin-top: 0;\n    // }\n\n    // .layout__content {\n    //   @include flex-col(12);\n    //   display: flex;\n    //   flex: 1 0 auto; // flex-grow 1\n    //   flex-direction: column;\n    //   margin-top: 0;\n    // }\n    //\n    // **********************************************\n\n  }\n\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: desktop & wider\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-md {\n\n  .product--related {\n    //\n  }\n\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: large\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-lg {\n\n  .product--related {\n    //\n  }\n\n}\n","////////////////////////////////////////////////////////////////////////////////\n// *\n// * Headings: helpers\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Mixins to manage & share the styling\n// =============================================================================\n\n@mixin headings {\n  font-family: $font-heading;\n  font-weight: $font-weight-bold;\n\n  a,\n  a:visited {\n    text-decoration: none;\n    color: $color-link;\n  }\n\n  a:hover {\n    text-decoration: underline;\n    color: $color-link;\n  }\n}\n\n@mixin h1 {\n  margin: 0 0 rem($gap-vert) 0;\n  @include font-size($h1-size, $h1-line, true);\n  color: $h1-color;\n}\n\n@mixin h2 {\n  margin: 0 0 rem($gap-vert-sm) 0;\n  @include font-size($h2-size, $h2-line, true);\n  color: $h2-color;\n}\n\n@mixin h3 {\n  margin: 0 0 rem($gap-vert-sm) 0;\n  @include font-size($h3-size, $h3-line, true);\n  color: $h3-color;\n}\n\n@mixin h4 {\n  margin: 0 0 rem($gap-vert-sm) 0;\n  @include font-size($h4-size, $h4-line, true);\n  color: $h4-color;\n}\n\n@mixin h5 {\n  margin: 0 0 rem($gap-vert-xs) 0;\n  @include font-size($font-size-base, $line-height-base, true);\n  color: $color-base;\n}\n\n@mixin h6 {\n  @include h5;\n}\n",'////////////////////////////////////////////////////////////////////////////////\n// *\n// * Links: helpers\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Mixins\n// =============================================================================\n\n// ** underlined link: using pseudo element so we can animate it\n//\n// -- Usage normal: starts with an underline and disappears on hover\n//      @include link-underline((color: red, color-hover: blue));\n// -- Usage inversed: an underline only appears when hovered\n//    @include link-underline(inverse: true);\n\n@mixin link-underline($settings) {\n\n  $color: map-get($settings, color);\n  $color-hover: map-get($settings, color-hover);\n  $color-active: map-get($settings, color-active);\n  $inverse: map-get($settings, inverse);\n\n  @if ($color == null) {\n    $color: $color-base;\n  }\n  @if ($color-hover == null) {\n    $color-hover: $color;\n  }\n  @if ($color-active == null) {\n    $color-active: $color-hover;\n  }\n  @if ($inverse == null) {\n    $inverse: false;\n  }\n\n  position: relative;\n  display: inline; // otherwise wrapping of the border bottom doesn\'t work\n  transition: color $duration $easing,\n    background-color $duration $easing,\n    border $duration $easing;\n\n  &,\n  &:visited {\n    color: $color;\n\n    @if ($inverse == true) {\n      border-bottom: 1px solid rgba($color-hover, 0);\n    } @else {\n      border-bottom: 1px solid rgba($color, 1);\n    }\n  }\n\n  &:hover {\n\n    color: $color-hover;\n\n    @if ($inverse == true) {\n      border-bottom: 1px solid rgba($color-hover, 1);\n    } @else {\n      border-bottom: 1px solid rgba($color, 0);\n    }\n\n  }\n\n  &:active {\n\n    color: $color-active;\n\n    @if ($inverse == true) {\n      border-bottom: 0 none;\n    } @else {\n      border-bottom: 1px solid rgba($color, 0);\n    }\n\n  }\n}\n\n\n// ** More Link\n// -- Used on teasers\n@mixin link-more {\n  display: inline-block;\n  text-decoration: none;\n  @include text-nobreak;\n\n  @include link-underline((\n    color: $color-spot-2,\n    color-hover: $color-spot-1,\n    color-active: $color-spot-1\n  ));\n}\n\n// ** More Link Big\n// -- Used with Views on homepage\n@mixin link-more-big {\n\n  @include font-size(16, 23);\n  font-weight: 500; // medium\n  text-transform: uppercase;\n\n  @include font-awesome((icon: $fa-var-long-arrow-right, size: 16, type: "regular", element: "before", margin: 0 rem(5) 0 0 ));\n  @include text-nobreak;\n\n  &:before {\n    position: relative;\n    top: -1px;\n    color: $color-spot-2;\n    transition: none;\n  }\n\n  &,\n  &:visited {\n    color: $color-spot-1;\n  }\n\n  &:hover,\n  &:active {\n    color: $color-spot-2;\n  }\n}\n\n// ** Back Link\n// --\n@mixin link-back {\n  display: inline-block;\n  text-decoration: none;\n  @include font-awesome((icon: $fa-var-angle-left, size: 14, type: "light", element: "before", margin: 0 rem(5) 0 0));\n  @include text-nobreak;\n\n  &:before {\n    transition: none; // prevent lagging on transition from link tag itself\n  }\n\n  &:after {\n    display: none;\n  }\n\n}\n',"////////////////////////////////////////////////////////////////////////////////\n// *\n// * CSS grid\n// *\n// * More on Flexbox (used here for fallback):\n//    https://css-tricks.com/snippets/css/complete-guide-grid/\n//\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Flex-row mixins\n// =============================================================================\n\n// ** make a uniform grid (columns, mostly)\n//\n//    Variables:\n//    - $columns: total columns of your grid system\n//    - $gap-hor: gap between the columns\n@mixin flex-grid($columns: $grid-columns, $gap-hor: $grid-gap-hor, $gap-vert: $gap-hor) {\n  position: relative;\n  display: flex;\n  flex-wrap: wrap;\n  overflow: hidden; // fix for non-collapsing margins\n  min-height: 1px;\n  margin-left: rem(-$gap-hor / 2);\n  margin-right: rem(-$gap-hor / 2);\n  margin-top: rem(-$gap-vert); // compensate for children top gaps\n}\n\n\n// ** set width of individual grid cell\n//\n//    Variables:\n//    - $number: number of columns your item is wide OR \"auto\" for autosizing\n//    - $columns: total columns of your grid system\n//    - $gap-hor: gap between the columns\n@mixin flex-col($number, $columns: $grid-columns, $gap-hor: $grid-gap-hor, $gap-vert: $gap-hor) {\n  position: relative;\n  margin-left: rem($gap-hor / 2);\n  margin-right: rem($gap-hor / 2);\n  margin-top: rem($gap-vert); // create gaps\n  min-height: 1px;\n\n  @if ($number == \"auto\") {\n    flex: 1 1 auto;\n    flex-basis: auto;\n    width: 100%; // mainly for IE\n    max-width: none;\n\n  } @else {\n    // IE doesn't do box-sizing: border-box when using flex/flex--basis, so can't use it\n    // IE11 doesn't understand calc() in shorthand flex, so need to set flex-basis explicitely\n    // And if you happen to use flex-basis to size stuff, you need an explicit width or max-width as well\n    // So probably best to not set flex-basis at all\n    // eg. flex: 0 0 calc(#{100% * $number / $columns} - #{rem($gap-hor)});\n    //     flex-basis: calc(#{100% * $number / $columns} - #{rem($gap-hor)});\n    flex: 0 0 auto;\n    flex-basis: auto;\n    width: calc(#{100% * $number / $columns} - #{rem($gap-hor)});\n  }\n}\n\n\n// ** pull using position relative\n//\n//    Variables:\n//    - $size: number of columns to move\n//    - $columns: total columns of your grid system\n//    - $gap-hor: gap between the columns\n@mixin flex-col-pull($number, $columns: $grid-columns, $gap-hor: $grid-gap-hor, $gap-vert: $gap-hor) {\n  position: relative;\n  left: #{100% * -$number / $columns};\n}\n\n// ** push using margin relative\n//\n//    Variables:\n//    - $size: number of columns to move\n//    - $columns: total columns of your grid system\n//    - $gap-hor: gap between the columns\n@mixin flex-col-push($number, $columns: $grid-columns, $gap-hor: $grid-gap-hor, $gap-vert: $gap-hor) {\n  position: relative;\n  left: #{100% * $number / $columns};\n}\n\n\n// ** create cells that span multiple rows: this is for the row wrapper\n\n@mixin flex-rows($height, $columns: $grid-columns, $gap-hor: $grid-gap-hor, $gap-vert: $gap-hor) {\n  position: relative;\n  display: flex;\n  flex-wrap: wrap;\n  flex-direction: column; // very important !!!\n  height: $height; // need a height in order to stretch over\n  margin-left: #{rem(-$gap-hor / 2)};\n  margin-right: #{rem(-$gap-hor / 2)};\n}\n\n// ** create cells that span multiple rows: this is for cells\n//    don't forget to mess around with 'order' to get the order you need\n\n@mixin flex-row($height, $rows: 2, $gap-hor: $grid-gap-hor, $gap-vert: $gap-hor) {\n  flex: 0 0 calc(#{100% * $height / $rows} - #{rem($gap-hor)});\n  // IE11 doesn't understand calc() in shorthand\n  flex-basis: calc(#{100% * $height / $rows} - #{rem($gap-hor)});\n}\n",'////////////////////////////////////////////////////////////////////////////////\n// *\n// * Blog teasers\n// *\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// *\n// =============================================================================\n\n.product--teaser {\n  // background-color: $color-product-teaser-bg;\n\n  // ** visual\n\n  .layout__sidebar {\n    margin-bottom: rem($gap-vert-sm);\n  }\n\n  // ** content\n\n  .layout__content {\n    // padding: 0 rem($padding-product-teaser) rem($padding-product-teaser) rem($padding-product-teaser);\n  }\n\n  // ** title\n\n  h2,\n  h3 {\n    @include h3;\n  }\n\n  // ** description: hidden in advanced teasers\n\n  .advanced {\n    .field--name-field-product-teaser {\n      @include hide;\n    }\n  }\n\n  // ** Properties & categories: Facet filters\n\n  .field--name-field-product-category,\n  .field--name-field-product-property-one,\n  .field--name-field-product-property-two,\n  .field--name-field-product-attributes {\n    display: flex;\n    flex-wrap: wrap;\n    margin-bottom: rem(5);\n    align-items: flex-end;\n\n    // label\n\n    h3,\n    h4,\n    .label-value-item-label {\n      @include font-size($font-size-base, $line-height-base);\n      margin: 0 rem(10) 0 0;\n\n      @include text-nobreak;\n\n      &:after {\n        content: ":";\n        margin-left: rem(-4); // counteract the spacing\n      }\n    }\n\n    // value\n    a {\n      //\n    }\n  }\n\n  // ** Category\n\n  .field--name-field-product-category {\n    .field__items {\n      display: flex;\n      flex-wrap: wrap;\n      margin: rem(-5) rem(-2) 0 rem(-2);\n    }\n\n    .field__item {\n      display: flex;\n      align-items: flex-end;\n      justify-content: flex-end;\n      margin: rem(5) rem(2) 0 rem(2);\n\n      &:after {\n        content: ", ";\n      }\n\n      &:last-child {\n        &:after {\n          content: "";\n        }\n      }\n    }\n\n    .field__item:before,\n    .field__item:after,\n    a {\n      //\n    }\n\n    a {\n      //\n    }\n  }\n\n  // ** Product attributes\n\n  .field--name-field-product-attributes {\n\n    .field__items {\n      //\n    }\n  }\n\n  .field__item--name-field-product-attributes {\n    //\n  }\n\n  .label-value-item {\n    display: flex;\n    flex-wrap: wrap;\n  }\n\n  .label-value-item-label {\n    font-weight: $font-weight-bold;\n    margin-bottom: 0;\n    margin-right: rem(10);\n\n    @include text-nobreak;\n  }\n\n  .label-value-item-value {\n    //\n  }\n\n  // ** read more\n\n  .layout__content__row--bottom {\n    margin-top: rem($gap-vert-sm);\n  }\n\n  .field--name-node-link {\n    margin-top: rem($gap-vert-sm);\n    a {\n      @include link-more;\n    }\n  }\n\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: tablet & wider\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-xs-wide-only {\n\n  .product--teaser {\n\n    // ** the BASIC teaser: in 2 cols\n\n    .basic {\n\n      @include flex-grid();\n      margin-top: 0;\n\n      .layout__sidebar {\n        @include flex-col(6);\n      }\n\n      // ** content\n\n      .layout__content {\n        @include flex-col(6);\n        margin-top: 0;\n      }\n    }\n\n  }\n\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: tablet & wider\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-sm {\n\n  .product--teaser {\n\n    &,\n    .node__content {\n      display: flex;\n    }\n\n    .node__content {\n      width: 100%; // IE\n    }\n\n    // ** the BASIC teaser: in 2 cols + \'read more\' sticks to the bottom\n\n    .basic {\n\n      margin-top: 0;\n      width: 100%; // IE\n\n      .layout__sidebar {\n        @include flex-col(6);\n        flex: 0 1 auto; // no grow\n        margin-top: 0;\n      }\n\n      .layout__content {\n        @include flex-col(6);\n        // needed to manipulate content with flex\n        display: flex;\n        flex-direction: column;\n        flex: 1 0 auto; // grow\n        margin-top: 0;\n        // padding: rem($padding-product-teaser) rem($padding-product-teaser) rem($padding-product-teaser) rem(abs($padding-product-teaser - $grid-gap-hor));\n      }\n\n      // push the actions to the end\n      .layout__content__row--bottom {\n        display: flex;\n        flex-grow: 1;\n        flex-direction: row;\n        align-items: flex-end;\n      }\n    }\n\n    // ** the ADVANCED teaser: no colums (fill them out)\n\n    .advanced {\n\n      width: 100%; // IE\n\n      .layout__sidebar {\n        @include flex-col(12);\n        margin-top: 0;\n      }\n\n      .layout__content {\n        @include flex-col(12);\n        margin-top: 0;\n      }\n    }\n  }\n\n}\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: desktop\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-md {\n\n  .product--teaser {\n\n    // ** the ADVANCED teaser: no columns + \'read more\' sticks to the bottom\n\n    .advanced {\n\n      margin-top: 0;\n      flex-direction: column; // makes it so the shrink/grow of flex works\n\n      .layout__sidebar {\n        @include flex-col(12);\n        flex: 0 1 auto; // no grow\n        margin-top: 0;\n      }\n\n      .layout__content {\n        @include flex-col(12);\n        // needed to manipulate content with flex\n        display: flex;\n        flex-direction: column;\n        flex: 1 0 auto; // grow\n        margin-top: 0;\n      }\n\n      // push the actions to the end\n      .layout__content__row--bottom {\n        display: flex;\n        flex-grow: 1;\n        flex-direction: row;\n        align-items: flex-end;\n      }\n    }\n\n  }\n\n}\n','////////////////////////////////////////////////////////////////////////////////\n// *\n// * General Mixins (put specific ones in component files where applicable)\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n\n// * Overview\n// =============================================================================\n\n// ** clearfix\n// ** hide\n// ** full-bg\n// ** stretch\n// ** square\n// ** max-width\n// ** z-index\n\n// * Mixins\n// =============================================================================\n\n// ** Clearfix.\n// * Adds clearfix based on http://bourbon.io/docs/#clearfix\n// * use example =   @include clearfix\n\n@mixin clearfix {\n  &:after {\n    clear: both;\n    content: "";\n    display: table;\n  }\n}\n\n// ** Remove an element completely from view\n// but keep them available for screen readers.\n//\n// Used for information required for screen reader users to understand and use\n// the site where visual display is undesirable. Information provided in this\n// manner should be kept concise, to avoid unnecessary burden on the user.\n// "!important" is used to prevent unintentional overrides.\n\n@mixin hide {\n  position: absolute !important;\n  display: block !important;\n  clip: rect(1px, 1px, 1px, 1px) !important;\n  overflow: hidden !important;\n  height: rem(1) !important;\n  width: rem(1) !important;\n  word-wrap: normal !important;\n\n  &.focusable:focus {\n    position: fixed !important;\n    left: 0 !important;\n    top: 0 !important;\n    @include z-index("top", true);\n    display: block !important;\n    clip: auto !important;\n    overflow: visible !important;\n    height: auto !important;\n    width: auto !important;\n    background: $color-white;\n  }\n}\n\n\n// ** Make an element inside .container fill the viewport width and stay in place\n\n@mixin stretch {\n  position: relative;\n  left: 50%;\n  width: 100vw;\n  transform: translateX(-50%);\n}\n\n\n// ** Adds fullwidth background using given color.\n// options:\n// $color: the background color\n// $element: the pseudo-element\n// $stretch: if the background stretches horizontally to the edges of the browser window\n\n@mixin full-bg ($color, $element: before, $stretch: true) {\n  position: relative;\n  z-index: 5;\n\n  &:#{$element} {\n    content: "";\n    position: absolute;\n    top: 0;\n    right: 0;\n    bottom: 0;\n    left: 0;\n    z-index: -1;\n\n    display: block;\n    height: 100%;\n    @if($stretch == true) {\n      margin-left: calc((-100vw + 100%) / 2);\n      width: 100vw;\n    }\n\n    background-color: $color;\n  }\n}\n\n\n/**\n * Square mixin\n *\n * @param [Number] $dimensions = the height and width of the element\n */\n@mixin square($dimensions) {\n  width: $dimensions;\n  height: $dimensions;\n}\n\n\n// /**\n//  * Toggle element: Make stuff able to toggle open\n//  * options: change the "open" class\n//  */\n// @mixin toggle-element($openClass: "js-open") {\n//   @media screen {\n//     height: 100%;\n//     min-height: 100%;\n//     overflow: hidden;\n//     transition: max-height $duration $easing;\n\n//     .js & {\n//       max-height: 0;\n//     }\n//     .#{$openClass} & {\n//       max-height: 100vh;\n//     }\n//   }\n// }\n\n@mixin max-width($width: null) {\n\n  @if ($width == null) {\n    padding-left: rem($container-padding);\n    padding-right: rem($container-padding);\n    margin: 0 auto;\n    max-width: $max-width-xs;\n\n    @include bp-sm {\n      max-width: none;\n    }\n\n    @include bp-md {\n      max-width: $max-width-sm;\n    }\n\n    @include bp-lg {\n      max-width: $max-width-md;\n    }\n  } @else {\n    max-width: $width;\n  }\n}\n\n\n// -- call z-index from a list so you never lose overview\n//    and set it to important if you really really really need it\n// usage: @include(modal, important); => z-index: 1000 !important;\n@mixin z-index($key, $important: null) {\n  @if ($important == null or $important == false) {\n    z-index: map-get($z-index, $key);\n  } @else {\n    z-index: map-get($z-index, $key) !important;\n  }\n}\n','////////////////////////////////////////////////////////////////////////////////\n// *\n// * Product detail full: has its own view-mode of the news CT, with a DS template\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n.product--full {\n  //\n}\n\n// load font-family after font loaded\n.font-text-01-loaded .product__cols--full {\n  .field--name-field-product-category,\n  .field--name-field-product-property-one,\n  .field--name-field-product-property-two,\n  .field--name-field-product-attributes {\n    // label\n    h3,\n    .label-value-item-label {\n      font-family: $font-base;\n    }\n  }\n}\n\n.product__cols--full {\n\n  // ** create space between header & content and doormat/related products & content\n  padding: rem($gap-vert-top-xs) 0 rem($gap-vert-bottom-xs) 0;\n\n  // ** content\n  .layout__content__row--main {\n    margin-top: rem($gap-vert-top-xs);\n  }\n\n  // ** Title\n  h2 {\n    margin-bottom: 0; // reset because we use the wrapper with the teaser/props to add spacing\n  }\n\n  // ** Properties & categories: Facet filters\n\n  .field--name-field-product-category,\n  .field--name-field-product-property-one,\n  .field--name-field-product-property-two,\n  .field--name-field-product-attributes {\n\n    margin-bottom: rem(5);\n\n    // label\n    h3,\n    .label-value-item-label {\n      margin: 0;\n      font-family: $font-fallback;\n      @include font-size($font-size-base, $line-height-base);\n      font-weight: $font-weight-bold;\n      text-transform: none;\n      color: $color-base;\n\n      @include text-nobreak;\n\n      &:after {\n        content: ":";\n        margin-left: rem(-4);\n      }\n    }\n\n    // value\n    a {\n      //\n    }\n  }\n\n  // ** category\n\n  .field--name-field-product-category {\n    .field__items {\n      display: flex;\n      flex-wrap: wrap;\n      margin: rem(-5) rem(-2) 0 rem(-2);\n    }\n\n    .field__item {\n      display: flex;\n      align-items: flex-end;\n      justify-content: flex-end;\n      margin: rem(5) rem(2) 0 rem(2);\n\n      &:after {\n        content: ", ";\n      }\n\n      &:last-child {\n        &:after {\n          content: "";\n        }\n      }\n    }\n\n    .field__item:before,\n    .field__item:after,\n    a {\n      //\n    }\n\n    a {\n      //\n    }\n  }\n\n  // ** Product attributes\n\n  .field--name-field-product-attributes {\n    margin-bottom: 0;\n\n    .field__items {\n      width: 100%; // otherwise it collapses bc of flexbox later on\n    }\n  }\n\n  .field__item--name-field-product-attributes {\n    //\n  }\n\n  // label\n\n  .label-value-item-label {\n    display: block;\n    font-weight: $font-weight-bold;\n    margin-bottom: rem(5);\n\n    @include text-nobreak;\n  }\n\n  // value\n\n  .label-value-item-value {\n    display: inline;\n  }\n\n  // ** description\n\n  .block--field-blocknodeproductfield-product-description {\n    margin-top: rem($gap-vert-top-xs);\n  }\n\n  // ** Buttons\n\n  .layout__content__row--bottom {\n    margin-top: rem($gap-vert-top-xs);\n  }\n\n  // PDF download\n\n  .field--name-field-media-file {\n\n    .file {\n      padding-left: 0; // don\'t need space for icon\n    }\n\n    .icon {\n      display: none; // don\'t need icon\n    }\n\n    a {\n      @include button-secondary;\n    }\n  }\n\n  // Contact button\n\n  .rs-configurable-link-formatter {\n    margin-top: rem($gap-vert-sm);\n  }\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: tablet & wider\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-sm {\n\n  // *\n  // =============================================================================\n\n  .product--full {\n    //\n  }\n\n  .product__cols--full {\n\n    // ** create space between header & content and doormat/related products & content\n    padding: rem($gap-vert-top-sm) 0 rem($gap-vert-bottom-sm) 0;\n\n    // ** picture\n\n    .layout__sidebar {\n      @include flex-col(6);\n    }\n\n    // ** product info\n\n    .layout__content {\n      @include flex-col(6);\n      padding-left: rem($grid-gap-hor); // extra space next to picture\n    }\n\n    // ** content\n    .layout__content__row--main {\n      margin-top: rem($gap-vert-top-sm);\n    }\n\n    // ** Properties & categories: Facet filters\n\n    .field--name-field-product-category,\n    .field--name-field-product-property-one,\n    .field--name-field-product-property-two,\n    .field--name-field-product-attributes {\n      display: flex;\n      flex-wrap: wrap;\n      align-items: flex-end;\n\n      // label\n      h3,\n      .label-value-item-label {\n        padding-right: rem(20);\n        width: 33%; // force a min-width on table cell\n      }\n    }\n\n    // ** category\n\n    .field--name-field-product-category {\n      .field__items {\n        width: 66%;\n      }\n    }\n\n    // ** Product attributes\n\n    .label-value-item {\n      display: flex;\n      flex-wrap: wrap;\n    }\n\n    // label\n\n    .label-value-item-label {\n      display: inline-block;\n      padding-right: rem(20);\n      min-width: 33%; // force a min-width on table cell\n    }\n\n    // ** description\n\n    .block--field-blocknodeproductfield-product-description {\n      margin-top: rem($gap-vert-top-sm);\n    }\n\n    // ** Buttons\n\n    .layout__content__row--bottom {\n      margin-top: rem($gap-vert-top-sm);\n    }\n  }\n\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: desktop\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-md {\n\n  // *\n  // =============================================================================\n\n  .product--full {\n    //\n  }\n\n  .product__cols--full {\n\n    // ** create space between header & content and doormat/related products & content\n    padding: rem($gap-vert-top-md) 0 rem($gap-vert-bottom-md) 0;\n\n    // ** product info\n\n    .layout__content {\n      padding-left: rem($grid-gap-hor * 2); // extra space next to picture\n    }\n\n    // ** content\n    .layout__content__row--main {\n      margin-top: rem($gap-vert-top-md);\n    }\n\n    // ** description\n\n    .block--field-blocknodeproductfield-product-description {\n      margin-top: rem($gap-vert-top-md);\n    }\n\n    // ** Buttons\n\n    .layout__content__row--bottom {\n      margin-top: rem($gap-vert-top-md);\n    }\n  }\n\n}\n\n\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n// * Breakpoint: large\n// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *\n\n@include bp-lg {\n\n  // *\n  // =============================================================================\n\n  .product--full {\n    //\n  }\n\n  .product__cols--full {\n\n    // ** create space between header & content and doormat/related products & content\n    padding: rem($gap-vert-top-lg) 0 rem($gap-vert-bottom-lg) 0;\n\n    // ** product info\n\n    .layout__content {\n      padding-left: rem($grid-gap-hor * 3); // extra space next to picture\n    }\n  }\n\n}\n','////////////////////////////////////////////////////////////////////////////////\n// *\n// * Buttons (in forms and text)\n// *\n// *\n////////////////////////////////////////////////////////////////////////////////\n\n// * Mixins\n// =============================================================================\n\n// ** Button mixins: use this for buttons used on the site\n// -- OPTIONS:\n//    - background: the background-color you want (will darken on hover), default from config = spot color\n//    - color: the text color you want (no change on hover by default), default from config = white\n//    - border: a border around your button, will darken on hover\n//    - size: default is false (normal size), it references another mixin to set more sizes (@mixin button-size)\n// -- NOTE: remove what doesn\'t apply to the buttons used on the site or edit to your needs\n\n@mixin button-size($size, $inverse: false) {\n  @if ($size == "sm") {\n    padding: rem(9) rem(14) rem(9) rem(14);\n    @include font-size(12, 14);\n  }\n}\n\n@mixin button($settings: null) {\n\n  // some defaults, used in case no $settings were given\n  // or when either of the settings is omitted\n  $color-default: $color-button;\n  $background-default: $color-button-bg;\n  $border-default: false;\n  $border-width-default: 2px;\n  $hover-default: $color-button;\n  $hover-bg-default: $color-button-hover-bg;\n  $hover-border-default: false;\n  $size-default: "md";\n  $border-radius-default: 0;\n  $box-shadow-default: false;\n\n  // set up the actual variables that will be used\n  $color: null;\n  $background: null;\n  $border: null;\n  $border-width: null;\n  $hover: null;\n  $hover-bg: null;\n  $hover-border: null;\n  $size: null;\n  $border-radius: null;\n  $box-shadow: null;\n\n  // map the variables to the settings if actual settings are passed\n  @if ($settings != null) {\n    $color: map-get($settings, color);\n    $background: map-get($settings, background);\n    $border: map-get($settings, border);\n    $border-width: map-get($settings, border-width);\n    $hover: map-get($settings, hover);\n    $hover-bg: map-get($settings, hover-bg);\n    $hover-border: map-get($settings, hover-border);\n    $size: map-get($settings, size);\n    $border-radius: map-get($settings, border-radius);\n    $box-shadow: map-get($settings, box-shadow);\n  }\n\n  // if any are not filled in, fall back to defaults\n  @if ($background == null) {\n    $background: $background-default;\n  }\n  @if ($border == null) {\n    $border: $border-default;\n  }\n  @if ($border-width == null) {\n    $border-width: $border-width-default;\n  }\n  @if ($color == null) {\n    $color: $color-default;\n  }\n  @if ($hover == null) {\n    $hover: $hover-default;\n  }\n  @if ($hover-bg == null) {\n    $hover-bg: $hover-bg-default;\n  }\n  @if ($hover-border == null) {\n    $hover-border: $hover-border-default;\n  }\n  @if ($size == null) {\n    $size: $size-default;\n  }\n  @if ($border-radius == null) {\n    $border-radius: $border-radius-default;\n  }\n  @if ($box-shadow == null) {\n    $box-shadow: $box-shadow-default;\n  }\n\n  cursor: pointer;\n  display: inline-block;\n  padding: rem(14) rem(25) rem(12) rem(25);\n  border: 0 none;\n  border-radius: $border-radius;\n  @include font-size(12, 14);\n  font-weight: bold;\n  text-align: center;\n  text-decoration: none;\n\n  background: $background;\n  background-repeat: no-repeat;\n\n  outline: none;\n  transition: background $duration $easing, color $duration $easing, box-shadow $duration $easing;\n\n  // add border via box-shadow, so we don\'t have to mess with changes in padding when there is none\n  // also keep into account that there might already be a box-shadow, so you have to combine the 2\n\n  // shadow + border\n  @if ($box-shadow != false and $border != false) {\n    box-shadow: 0 3px 20px rgba($color-black, .2), inset 0 0 0 $border-width $border;\n\n    // only shadow\n  } @else if ($box-shadow != false) {\n    box-shadow: 0 3px 20px rgba($color-black, .2);\n\n    // only border\n  } @else if ($border != false) {\n    box-shadow: inset 0 0 0 $border-width $border;\n  }\n\n  // load other sizes (if any)\n  @include button-size($size);\n\n  &,\n  &:visited {\n    color: $color;\n  }\n\n  &:hover,\n  &:active {\n    border: 0 none;\n    color: $hover;\n    background: $hover-bg;\n    outline: none;\n\n    // shadow + hover border\n    @if ($box-shadow != false and $hover-border != false) {\n      box-shadow: 0 3px 20px rgba($color-black, .2), inset 0 0 0 $border-width $hover-border;\n\n      // only shadow\n    } @else if ($box-shadow != false and $hover-border == false) {\n\n      // if normal state has border, let\'s animate to that\n      @if ($border != false) {\n        box-shadow: 0 3px 20px rgba($color-black, .2), inset 0 0 0 $border-width rgba($border, 0);\n\n        // otherwise, just leave the shadow\n      } @else {\n        box-shadow: 0 3px 20px rgba($color-black, .2);\n      }\n\n      // only hover border\n    } @else if ($box-shadow == false and $hover-border != false) {\n      box-shadow: inset 0 0 0 $border-width $hover-border;\n\n      // no hover borders && no shadow\n    } @else {\n\n      // normal state does have border, so we need to animate to 0% opacity\n      @if ($border != false) {\n        box-shadow: inset 0 0 0 $border-width rgba($border, 0);\n      }\n\n      // normal state does not have a border, so we don\'t need to do anything\n\n    }\n  }\n\n  &:focus,\n  &:focus:hover {\n    outline: 0;\n  }\n\n  &.disabled,\n  &:disabled,\n  &[disabled] {\n    pointer-events: none; // no support in IE10\n    cursor: default;\n    opacity: .5;\n  }\n}\n\n// ** Example of use: to make a specific button\n//\n// -- Need a gradient background instead of a color? Just use the gradient property.\n//    eg. background: linear-gradient(to right, red, yellow),\n//    eg. hover-bg: linear-gradient(to right, yellow, red),\n//\n@mixin button-primary($size:"md") {\n  $settings-button-primary: (\n    color: $color-white,\n    background: $color-spot-2,\n    hover: $color-white,\n    hover-bg: $color-button-hover-bg,\n    size: $size,\n    border-radius: 6px\n  );\n  @include button($settings-button-primary);\n}\n\n@mixin button-primary-2($size:"md") {\n  $settings-button-primary-2: (\n    color: $color-white,\n    background: $color-spot-1,\n    hover: $color-spot-1,\n    hover-bg: $color-white,\n    size: $size,\n    border-radius: 6px\n  );\n  @include button($settings-button-primary-2);\n}\n\n@mixin button-secondary($size:"md") {\n  $settings-button-secondary: (\n    color: $color-spot-1,\n    border: $color-spot-2,\n    background: transparent,\n    hover: $color-white,\n    hover-bg: $color-button-hover-bg,\n    hover-border: false,\n    size: $size,\n    border-radius: 6px\n  );\n  @include button($settings-button-secondary);\n}\n\n@mixin button-negative($size:"md") {\n  $settings-bu